(198, 4, '2012-11-22 06:25:47', 'Magento Easy Catalog Images 2.0 is now available', 'Easy Catalog Images 2.0  is now available with next new features\n\nGeneral:\n-  Perfomance improvements. Dramatically decreased query count per block render (One query).\n-  Cache support added.\n-  Flexible grid styles added to support multicolumn mode for various site styles without modifying the styles. 2-6 columns are supported out of the box.\n-  Category thumbnail is displayed instead of category image by default.\n-  Widget support added. Widget is fully configurable with custom options. You can insert the Easy Catalog Images where you wish to. (Any cms page, block etc)\n-  EasyCatalogImages block is now shown above the category title. We did this to prevent numerous conflicts with custom themes.\nConfiguration improvements:\n-  Maximum category count to show added.\n-  Ability to set the background color for resized image. White by default.\n\nRemoved features. (Removed to improve compatibility with custom themes)\n-  ''Show categories listing'' on homepage removed. Please use the homepage editor and add Easy Catalog Images widget directly to the homepage content.\n-  Alibity to disable product listing removed. Please use the built-in Magento option on category edit page.\n-  ''Show child categories'' field removed. Please use the ''Number of subcategories to show'' field get the same result.\n\n', 'http://bit.ly/SX6qdg', 0, 1),
