(217, 4, '2013-04-02 08:38:44', 'Get Mobile star template with improved Retina screen support', 'Get Mobile star template with improved Retina screen support', 'http://bit.ly/XGcgqk', 0, 1),
(218, 4, '2013-04-08 08:26:03', 'Improve your layered navigation with Ajax Layered Navigation 1.2.2 ', 'Improve your layered navigation with Ajax Layered Navigation 1.2.2 ', 'http://bit.ly/Zd5gxb', 0, 1),
(219, 4, '2013-04-11 08:57:51', 'Attract your customers attention with Prolabels 1.2.2', NULL, 'http://bit.ly/12MmKaK', 0, 1),
(220, 4, '2013-04-17 03:10:46', 'Fire Checkout 2.4.1 is now available ', 'Fire Checkout 2.4.0 is now available with next new features:\n\n- MageWorx Customercredit integration\n- Css improvements for mobile and tablet devices\n- First available shipping will not selected if default one is not found\n- Fixed shipping price, when weight vs destination is used. Matrix rate compatibility added.\n- Kiala LocateAndSelect integration added\n- BillPay compatibility\n- Comptibility with Magento per-country postcode and region configuration added', 'http://bit.ly/YTOUyh', 0, 1),
(221, 4, '2013-04-23 08:21:53', 'Manage your store banners with Easy Banners 1.3.0 ', 'Easy Banners 1.3.0  is now available with next new features:\n\n- Ability to set image size added\n- Optional retina support added\n- Ability to use banner url for html mode added. Use the {{tm_banner_url}} variable in banner content.\n- Backend banner management interface improvements\n- Image dimensions added to html markup, when resizer is used\n', 'http://bit.ly/15EcDW5', 0, 1),
(222, 4, '2013-04-24 07:41:53', 'Argento responsive theme 1.1.2 is now available', ' Argento update\n\n*    Html markup and css improvements. YSlow - 86 PageSpeed - 93\n*    Review url fixed on product page\n*    Lightboxpro config options updated to look good on mobile screens\n*    Related products styles and image size improvements for small screen devices\n*    All small images styles improved for mobile devices\n*    Improved form styles\n*    Fixed product listing on advanced search results\n*    Facebook Like Button added\n*    Scroll to top button added\n\nSoldtogether updated\n\n*    Table prefix added to query\n*    Amazon styled template will show only simple products\n*    Fixed price calculation for bundle, configurable and grouped products when using amazon template\n*    Colection queries improvements\n\nEasyslide updated\n\n*    jQuery will not be added if nivo slider is not used\n*    Default slider options added when creating new slider\n*    Enabled option removed. Please use status option for each slider instance.\n*    Load jQuery option now affects on adding jQuery library only: nivo javascript will be added if nivo slider is used.\n\nEasycatalogimg updated\n\n*    Optional retina support added\n*    Image dimensions added to html markup\n\nEasybanner updated\n\n*    Ability to set image size added\n*    Optional retina support added\n*    Ability to use banner url for html mode added. Use the {{tm_banner_url}} variable in banner content.\n*    Backend banner management interface improvements\n*    Image dimensions added to html markup, when resizer is used\n', 'http://bit.ly/XWJ7pO', 0, 1),
(223, 4, '2013-04-27 21:48:07', 'Improve your newsletter marketing  performance with Newsletter Booster', NULL, 'http://bit.ly/ZLmOpn', 0, 1),
(224, 4, '2013-05-10 08:06:19', 'Improve your conversion rate with Fire Checkout 2.4.2', 'Fire Checkout 2.4.2 is now available with next new features:\n\n- Enterprise version compatibility update\n- New registration mode: Guest checkout is allowed and registration checkbox is checked by default\n- Ability to set the default checkbox state for shipping address and newsletter subscription\n- Configuration options grouped into smaller parts', 'http://bit.ly/Yz1eT6', 0, 1),
(225, 4, '2013-05-14 03:07:57', 'Ajax search security update 1.3.1', '- Security update. There was no security threat but bug can be considered as potential threat. ', 'http://bit.ly/19mHSSF', 0, 1),
(226, 4, '2013-05-20 06:58:09', 'Argento 1.2 with new Pure design is now available', 'Argento update:\n\n*    New Pure theme added\n*    Css styles optimization\n*    Css styles improvements for small tablet devices\n*    Removed php warnings during Argento installation\n*    Fixed upsell products decoration with first/last classes\n*    AjaxSearch updated - Security bugfix\n*    Easyslide updated - Nivo slider updated\n*    Askit updated - Grammar errors fixed\n*    Easybanner updated - Title field should not be required, when using html mode\n*    Facebook Like Button updated - Fixed access to facebook like button config section when internet connection is not available\n*    Highlight updated - Added translation of the highlight page title\n*    Soldtogether updated - Fixed bug, when no product is available, but soldtogether block is called', 'http://bit.ly/114IWeX', 0, 1),
(227, 4, '2013-05-28 06:43:12', 'Improve your shopping experience with Quick Shopping 1.2.0', 'Quick Shopping 1.2.0  is now available with next new features:\n\n- Templates and skin resources moved to base folder\n- Better compatibility with third-party themes\n- Highlight page support added\n- Updated styles for window and button\n- Layout xml optimization\n- Better javascript handling of response text\n- Amlanding integration added\n- QuickView button will be hidden if no css and js are loaded.', 'http://bit.ly/10Eoz3x', 0, 1),
(228, 4, '2013-06-04 07:42:38', 'Fire Checkout 2.4.3 is now available ', 'Fire Checkout 2.4.3 is now available with next new features:\n\n- Check for minimum amount when removing item from cart fixed.\n- No more unnecessary captcha refreshes, when updating page content.\n- Fixed optional and hidden region field for Magento 1.6.2 and earlier\n- Fixed hidden postcode field\n- Fixed bug when Mage_Persitent was disabled with etc/modules file\n- Improved compatibility with third-party themes, that used height style for input fields\n- Added parsing of System is busy message from VIES validator\n- AheadWorks Newsletter module integration added\n- Integration with Irvine DeliveryDate and JapanPost added\n- Partial uSplitRates integration added. Still needs to edit app/code/local/TM/FireCheckout/Model/Quote/Address.php\n- Partial integration with Stripe payment methods added. Need to edit stripe/form/stripe.phtml', 'http://bit.ly/11itvv9', 0, 1),
(229, 4, '2013-06-19 08:08:43', 'Allow your customers to create user generated content with Askit 2.0 ', 'Askit 2.0  is now available with next new features:\n\n Features\n- Allow to place discussion block on cms and categories pages\n- Added page with all products discussion at your store\n- Added products question search on all products page\n- Widget for recent discussion was added\n- Added folded or unfolded default states for products discussion\n\nFixes\n- Added notifications for additional responses by other visitors.\n', 'http://bit.ly/11ZuXG2', 0, 1),
(230, 4, '2013-07-02 07:40:16', 'Improve your store navigation with Layered Navigation 2.0', 'Layered Navigation 2.0 is now available with next new features:\n\n- SEO links for layered navigation\n- Optional non-follow element\n- Performance update - works 80% faster!\n- Optionally show search form if there is larger then x number of attributes\n- New layered navigation styles added', 'http://bit.ly/17R8pfW', 0, 1),
(231, 4, '2013-07-04 07:59:59', 'Save 20% on all themes and extensions with our Independence day sale! ', 'Save 20% on all themes and extensions with our Independence day sale! ', 'http://bit.ly/13v8dAa', 0, 1),
(232, 4, '2013-07-08 05:34:18', 'Increase your store sales with Firecheckout 2.4.4', 'Fire Checkout 2.4.3 is now available with next new features:\n\n- One firecheckout version for Magento 1.4.2.0-1.7.0.2\n- Irvine shipping methods integration added\n- Undefined warning removed, when using one line for address field\n- Compatibility with third party themes, that using border-box style for all elements\n- Customer credit integration fixed\n- Billsafe Integration\n- Euvat extension compatibility added\n- Ability to reload order totals on taxvat change added\n- Fixed displaying of Email already in use window\n- Password will not be copied to OrderReview section\n- Fixed ugiftcert warning when applying coupon code\n- Checkoutfields will not redefine pdf print models, to prevent conflicts with \n other pdf modules. To enable checkoutfields printing, follow instructions from \n checkoutfields configuration options', 'http://bit.ly/1d9NOAC', 0, 1),
(233, 4, '2013-07-11 08:24:26', 'Increase your store speed up to 400% with Page Cache extension!', NULL, 'http://bit.ly/12tDWM3', 0, 1),
(234, 4, '2013-08-05 09:54:01', 'Improve your products page design with Easy Tabs 2.0', 'Easy Tabs  2.0 is now available with next new features:\n\n- New backend interface with separate page\n- Skins and templates moved to base folder\n- Unlimited number of tabs\n- Responsive styles added', 'http://bit.ly/16uYnOn', 0, 1),
(235, 4, '2013-08-08 06:25:38', 'Magento Page Cache 1.0.2 is now available', 'Magento Page  Cache 1.0.2 is now available with next new features:\n\n- Session params added to cache key at required pages (listing mode, limit etc)\n- Added support of dynamic blocks in custom_layout_update xml directive\n- Fixed cache cleaning when mass delete is used\n- Added support for cache auto refresh for Quickshopping module\n\n', 'http://bit.ly/13IPu3j', 0, 1),
(236, 4, '2013-08-14 08:48:05', 'Argento 1.3 is now available with backend CSS configuration ', 'Argento update:\n\nArgento update\n*    Fixed displaying of decimal quantities in header cart\n*    Removed overriding of customer.xml layout\n*    Css styles was refactored. Duplicate code removed.\n*    Automatic inclusion of custom.css file from active theme skin folder\n\nBackend configuration for theme styles added\n*    Background\n*    Top navigation\n*    Buttons (ArgentoPure only)\n*    Tabs\n*    Fonts\n*    Additional custom css\n*    Ability to add additional head links (Google fonts for example)\n\nEasytabs\n*    Easy tabs 2.0 integrated\n\nAjaxSearch\n*    Fixed search form submit by clicking the search button\n\nSuggestPage\n*    ajaxpro compatibility fixed\n\nAjaxPro\n*    Fixed wishlist link for secure pages\n\nHighlight\n*    Currency code added to cache key\n*    Fixed building of product url, when category path in product url is disabled from backend\n*    Fixed filtering of the one day only available products\n\nSoldTogether\n*    Fixed filtering of products on suggestpage\n*    Fixed price formatting for amazon style template\n\nCore\n*    Notifier filter by news channel added\n*    Magento 1.4 compatibility added', 'http://bit.ly/16brXYz', 0, 1),
(237, 4, '2013-08-19 06:51:11', 'Newsletter Booster 1.2.0 with advanced newsletter features is now available', 'Newsletter Booster 1.2.0 is now available with next new features:\n\n- Campaigns can be set to be visible on front end so customers can subscribe to one that they are interested at\n- Subscribers can now un-subscribe and subscribe from separate segments\n- Separate newsletter tab is added to customer''s My account page\n- Send to multiply segments option was added in admin interface\n- Guest subscribe and queue\n- Support for anonymous email gateways\n- utm_content content support \n', 'http://bit.ly/19tgPay', 0, 1),
(238, 4, '2013-08-27 06:16:21', 'Improve your Magento store admin security with Improved admin security 2.0 extension ', ' Improved admin security 2.0 extension   is now available with next new features:\n\n- Admin actions logs added\n- Advanced control over admin user ip address used added\n- Admin login actions log added\n', 'http://bit.ly/1djLRFY', 0, 1),
(239, 4, '2013-09-02 08:21:50', 'Increase your revenue with Firecheckout 2.4.5 ', 'Fire Checkout 2.4.5 is now available with next new features:\n\n- Added support for quantity increments when using +/- buttons in shopping cart\n- AddressFields status save: Warning message removed in Magento 1.5.0.1 and earlier.\n- Validate form method created to allow to validate firecheckout form from any script\n- Success page url changed to checkout/onepage/success to provide compatibility with third party tracking extensions\n- Fixed saving guest email and phone to quote on address refresh\n- Fixed saving of last selected address for registered users\n- Fixed sending order confirmation emails for magento 1.4.2\n- Fixed updating OrderReview section in IE10\n- Fixed click on single available payment method\n- Fixed error in billing form, when Mage_Newsletter module is disabled.\n- Imporved check for Mage_Capcha module. Added check for etc/modules status.\n- Added synchronization of klarna invoice form with address form\n- Infostrates TNT shipping method support added (need to edit tnt.js to add event firing, when ajax request is completed)\n- TigPostcode extension templates updated to the latest version\n- Givechange module integration\n- Klarna part integration added\n- Partial Amasty coupons integration. Still needs to edit Amasty_Coupons_Block to change template.\n- Partial webtext giftcard integration. Still need to edit giftcard.xml and CartController.php', 'http://bit.ly/1fus5EF', 0, 1),
(240, 4, '2013-09-06 08:19:20', 'Magento Easy Lightbox extension 3.0 is now available', NULL, 'http://bit.ly/17dnWDp', 0, 1),
(241, 4, '2013-09-10 06:15:35', 'Argento 1.3.1 is available. Now compatible with Magento Enterprise edition!', 'Argento update\n*    Magento Enterprise Edition compatibility\n*    Sweet tooth reward integrated into shopping cart template\n*    Main product image size increased to 370px\n*    Subtotal added to cart popup for Argento theme\n*    Fixed output of tags and other inline links, when html minifier extension is used\n*    Added additional theme fallback rules to simplify enterprise version compatibility\n*    Fixed broken print invoice page\n*    Fixed double call for EasyTabs block\n\nAjaxSearch updated\n*    Fixed filling the dummy search text after double click on input field\n*    Fixed sorting of categories in category combobox\n*    Fixed category search results\n*    Fixed automatic applying filter by category on search results page\n*    Layout and templates moved to base/default/tm folder\n\nEasyTabs updated\n*    Added missing containers to tag and review blocks\n*    Layout and templates moved to base/default/tm folder\n\nTM_Core updated\n*    Fixed error when AdminNotification module is disabled\n\nSoldtogether\n*    Updated to the newest version\n*    Fixed updating of the main product price, when soldtogether products are not found\n\nEasyCatalogImages\n*    Layout and templates moved to base/default/tm folder\n*    Fixed imagepath detection. Possible bug when media is used in domain name\n\nEasyBanner\n*    Fixed imagepath detection. Possible bug when media is used in domain name\n*    Added check for banner availability in store, when inline banner call is used\n', 'http://bit.ly/1b0Y0is', 0, 1),
(242, 4, '2013-09-19 06:10:33', 'Magento Page Cache 1.0.3 is now available!', 'Magento Page  Cache 1.0.3 is now available with next new features:\n\n- Compilation mode compatibility added\n- Fixed developer and inline translate modes per IP address\n- Fixed output of dynamic blocks called with inline method from cms block or page\n- Cache autorefresh support added for: TM_Askit, AW_Productquestions\n', 'http://bit.ly/1aNvf6g', 0, 1),
(243, 4, '2013-09-26 08:04:04', 'Magento Quick Shopping 1.2.3 is now available', 'Magento Quick Shopping 1.2.3 is now available  with next new features:\n\n- Responsive styles added\n- Removed big gap between image and content for wide quickshopping popup\n- Added ability to display additional images gallery in quickshopping window\n- Configuration options regrouped\n- Translation optimizations\n- Code cleanup\n', 'http://bit.ly/1eJTFBR', 0, 1),
(244, 4, '2013-10-07 08:25:35', 'Fire Checkout 2.4.6 is now fully compatible with Magento 1.8', 'Fire Checkout 2.4.6 is now available with next new features:\n\n-  Magento 1.8 code sync\n-  Secure key added to firecheckout form\n-  Fixed gradient image for firecheckout form sections\n-  DeliveryDate feature: Period in days when delivery will be available, since first available day\n-  Update of IrvineSystems modules integration\n-  TNT Infostrates observer fixed for ajax reloaded shipping methods\n-  Improved check for modules enabled status.\n-  J2t Rewardpoints integration updated\n\n', 'http://goo.gl/Tlv5Qu', 0, 1),
(245, 4, '2013-10-15 09:16:04', 'Argento 1.3.2 is available. Now fully compatible with Magento CE 1.8', 'Argento updates:\n\n*   Magento 1.8 compatibility\n*   Fixed custom.css url on secure pages\n*   custom.css is now included after theme.css\n*   AjaxPro popup styles improved\n*   Cookie restriction message made responsive\n*   Css fixes\n*   QuickShopping is now supported. No need to edit listing template.\n*   Various small fixes to all modules. More than 70 commits was done.\n', 'http://goo.gl/2PPWxD', 0, 1),
(246, 4, '2013-10-28 05:29:51', 'Make your store faster with Magento Page Cache 1.1 ', 'Magento Page  Cache 1.1.0 is now available with next new features:\n\n- Added per-page lifetime configuration\n- Added support for SmartSuggest blocks\n\n', 'http://goo.gl/unQtt5', 0, 1),
(247, 4, '2013-11-04 07:26:32', 'All our Magento themes and extensions are now fully compatible with Magento CE 1.8', 'We are glad to inform that all our templates were recently updated to Magento CE 1.8. Request your update at http://bit.ly/q51qxj ', 'http://goo.gl/w6tyCx', 0, 1);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(248, 4, '2013-11-07 08:14:03', 'Improve your checkout and order success page with Fire Checkout 2.5', '  Fire Checkout 2.5.0 is now available with next new features:\n\n-   Ability to add additional content on firecheckout page added\n-   Success page module added to firecheckout, that allows to customize order success page\n-    Fixed delivery date visibility in backend, when editing the order\n-    Resources moved to tm subfolder\n-    Netresearch_Billsafe module integration updated\n-    Improved AW_Rewards compatibility\n-    Removed warning about not existing Netresearch_Billsafe class\n-    Firecheckout_Adminhtml_Model moved to standard model folder\n-    firecheckout/review.phtml rewrite removed from checkoutfields module\n-    Dynamic layout loading added, that helps to provide out of the box integration with following modules:\n    AW_Newsletter, Billpay, Bysoft_Relaypoint, CraftyClicks, Ebizmarts_SagePaySuite, Enterprise_Enterprise, GCMC_GiveChange, Geissweb_Euvatgrouper, IntellectLabs_Stripe, IrvineSystems_Deliverydate, IrvineSystems_JapanPost, IrvineSystems_Sagawa, IrvineSystems_Seino, IrvineSystems_Yamato, Kiala_LocateAndSelect, Klarna_KlarnaPaymentModule ,Mage_Captcha, Magestore_Storepickup, MageWorx_MultiFees, Netresearch_OPS, Payone_Core, Phoenix_Ipayment, Rewardpoints // J2t Rewardpoints, Symmetrics_Buyerprotect, TIG_Postcode, Webtex_Gitcards\n    Unfortunately some of the modules still needs to be edited. But FireCheckout sources is ready to use without any modifications.-', 'http://goo.gl/RN9aoY', 0, 1),
(249, 4, '2013-11-19 11:38:25', 'Attract your customers attention with custom products blocks and Products Highlight 2.4', 'Products Highlight 2.4 is now available with next new features:\n\n-   Added reset of std list styles to properly display highlight block on cms pages\n-   Templates and skin moved to base folder\n-   Fixed filtering of the one day only available products\n-   Fixed building of product url, when category path in product url is disabled from backend\n-   Added currency code to cacheKey', 'http://goo.gl/8MVkyR', 0, 1),
(250, 4, '2013-11-26 09:24:00', 'Fire Checkout 2.5.1 is now available', 'Fire Checkout 2.5.1 is now available with next new features:\n\n- J2t Rewardpoints integration updated\n- Added additional reset styles and clears\n- Fixed output of the delivery date for different timezones\n- Updated template paths to include tm prefix\n- Fixed order submit button for virtual products\n- Fixed saving of the entered taxvat number on page reload\n- Checkoutsuccess page is now compatible with thrd-party order total modules\n- AW_Points integrated into checkoutsuccess page', 'http://goo.gl/pphCjN', 0, 1),
(251, 4, '2013-12-13 07:29:25', 'Make your shopping as fast as lighting with Ajax Pro 3.0', 'Ajax Pro 3.0 is now available with next new features:\n\n- Improved ajax update algorithm \n- Allows to show shopping cart, coupon code block and related products block in ajax cart window\n- Configurable list of blocks for ajax refresh for each action\n- Improved ajax progress window\n- Improved usability for add to cart and add to compare ajax action\n- Improved modal window script\n', 'http://goo.gl/0ces1y', 0, 1),
(252, 4, '2013-12-16 07:20:50', 'Create attractive landing pages and improve store navigation with Magento Brands and Attributes pages extension!', NULL, 'http://goo.gl/yp998j', 0, 1),
(253, 4, '2013-12-20 07:32:25', 'Improve traffic from search engines to your Magento store with Google Rich snippets 1.3.0', ' Rich snippets 1.3.0 is now available with next new features:\n\n-  Added Google+ Author feature support\n-  Added Breadcrumbs feature support\n-  Resources moved to base folder\n', 'http://goo.gl/PY54Zf', 0, 1),
(254, 4, '2013-12-24 06:04:53', 'Celebrate Christmas and save 20% on all themes and extensions with coupon code XMAS2013', 'We are glad to tell that our Christmas special offer starts today and it''s a great chance to get any our Magento extensions or template with 20% discount (). Our special offer ends on January 01 2014 so don''t miss your chance to improve your store!', 'http://goo.gl/368va0', 0, 1),
(255, 4, '2014-01-02 07:06:56', 'Improve your layered navigation with Ajax Layered Navigation 2.2', 'Ajax Layered Navigation 2.2 is now available with next new features:\n\n-    Improved slider javascript\n-    Now supports multiple sliders on same layered navigation block\n-    Added support for advanced layered navigation page\n-    Improved overall performance\n-    Attributes sort order fixed\n-    Fixed support of third level of seo url', 'http://goo.gl/qvWFBp', 0, 1),
(256, 4, '2014-01-08 01:44:42', 'Argento 1.4.0 with great Brands pages extension is now available. Now fully compatible with Magento CE 1.8.1! ', 'Argento updates:\n\n*   Magento 1.8.1 compatibility\n*    Attributepages and brands extension added\n*    Mobile navigation with backend configuration added\n*    Product page markup improved for mobile devices\n*    Css styles for small screen devices improved\n*    Contact form improvements: added tel and email types\n*    QuickShopping support added to pure theme product listing\n*    Fixed page zoom for touch devices, when focusing input elements\n*    Bugfix: TabBuilder: Cannot call method ''addClassName'' of undefined\n*    Fixed positioning of grouped item availability status\n*    Bundle for 1702 and older magento versions fixed\n*    Missing translations added\n*    Suggestpage integrated into ajaxpro popup window\n*    Soldtogether random collection is enabled for initial installation now\n*    AjaxPro\n*        Completely rewritten layout and blocks generating logic\n*        Configurable popup added\n*        Responsive styles added\n*        Various css and js fixes\n*        Improved css styles for all popups\n*        Improved overlay and spinner positioning\n*        Fixed ajax product listing on layered categories\n*        Overlay fade effect fixed\n*        Popup autohide functionality improved\n*        Fixed moving product to wishlist from shopping cart page\n*    Askit\n*    Attribute and Brands pages NavigationPro Integration\n*        Module is added to Argento\n*    EasyCatalogImg NavigationPro Integration\n*        Better integration with NavigationPro\n*        Added ability to select root category and filter categories to show/hide per widget.\n*    Easyslide\n*        Bugfix: https image url support added\n*    EasyTabs\n*        Added ability to get direct link to any tab\n*    LightboxPro\n*    NavigationPro\n*        Added mobile menu support\n*    RichSnippets\n*        Breadcrumbs support added\n*        Author support added\n', 'http://goo.gl/rIkhtH', 0, 1),
(257, 4, '2014-01-13 08:12:24', 'Fire Checkout 2.5.2 is now available', 'Fire Checkout 2.5.2 is now available with next new features:\n\n-   MageWorx_CustomerCredit integration updated\n-   AW_Advancednewsletter module integration added\n-   Taxvat validator now can receive number with coutry code\n-   Static block moved outside of ajax reloading review table block\n-   Rewardpoints reload added, when changing cart items\n-   Magento 1.8.1 compatibility. Wee tax calculation template ported from 1.8.1', 'http://goo.gl/S7WsMA', 0, 1),
(258, 4, '2014-01-17 03:58:04', 'Ajax Pro 3.1 is now available', 'Ajax Pro 3.1 is now available with next new features:\n\n- Added ability to integrate third-party module into ajaxpro popup\n- Improved css styles for all popups\n- Responsive styles added\n- Improved overlay and spinner positioning\n- Fixed ajax product listing on layered categories\n- Overlay fade effect fixed\n- Popup autohide functionality improved\n- Fixed moving product to wishlist from shopping cart page', 'http://goo.gl/Bjj1ha', 0, 1),
(259, 4, '2014-01-20 09:20:09', 'Magento Absolute and Classic themes are now fully compatible with Magento CE 1.8.1', NULL, 'http://goo.gl/Vx1MXY', 0, 1),
(260, 4, '2014-01-27 08:53:55', 'Meet new Magento templates prices from Templates Master!', NULL, 'http://goo.gl/E73JG9', 0, 1),
(261, 4, '2014-02-03 07:41:32', 'Improve your social media presence with Social Suite 1.4.0', 'Social Suite 1.4.0 is now available with next new features:\n\n- Optimized module configuration\n- Fixed aligment of social buttons\n- Secure head url fixed\n- Redesigned social discount modal window\n- Added responsive support for social discount modal window\n- Moved layout, template, css, js files to base/tm folder', 'http://goo.gl/vTdUwR', 0, 1),
(262, 4, '2014-02-10 07:04:10', 'Fire Checkout 2.5.3 is now available', 'Fire Checkout 2.5.3 is now available with next new features:\n\n-   SmartPost integration added\n-    Fixed applying of the payment method, when price filter for methods is used\n-    Backgrounds merged into single sprite image\n-    Removed popup window sprite image. Css3 is used instead.\n-    Overlay removed. Compatibility with address by postcode detection\n-    Klarna payment method integration update\n-    J2t Rewardpoints integration update\n-    SagePaySuite integration fix\n-    Additional css reset styles\n-    Module sort order updated\n-    Added error message about missing USPS user_id\n-    Address verification links replaced with buttons\n-    Additional checkmoney styles added to fix some themes', 'http://goo.gl/fXiMNb', 0, 1),
(263, 4, '2014-02-17 07:58:31', 'Improve your store navigation with Easy Catalog Images 2.3', 'Easy Catalog Images 2.3 is now available with next new features:\n\n-  Ability to hide block, when filter or pagination is applied.\n-  Ability to show widget on category pages, when category config is disabled.\n-  Widget: Ability to set Root Category to load\n-  Widget: Ability to show and hide specific categories\n-  NavigationPro integration styles added\n-  NavigationPro integration guide\n-  Automated thumbnail assignment added. Script can fill category thumbnails with image of first product of corresponding category. If category has attached thumbnail already, it will be skipped.         Only direct category children are processed. If category has no direct child products, thumbnail will not be assigned\n-  Css refactoring. Responsive styles added\n-  Added note about supported columns count to the widget interface\n-  Module sort order updated', 'http://goo.gl/feTo0q', 0, 1),
